import React from 'react';

const Education = () => {
    return (
        <section>
            <h2>Education</h2>
            <div>
                <h3>Arizona State University</h3>
                <p>B.S. Computer Informatics, Cum Laude</p>
            </div>
        </section>
    );
}

export default Education;
